# https://leetcode.com/problems/find-pivot-index/?envType=study-plan&id=level-1

def run(nums):
    l_sum = 0
    r_sum = sum(nums)

    for idx, item in enumerate(nums):
        r_sum -= nums[idx]
        if l_sum == r_sum:
            return idx
        l_sum += item
    return -1


